","value":"磁吸式安全锁"},{"name":"适用人群","value":"通用"},{"name":"安全须知","value":"使用时请佩戴安全锁一端的夹子，紧急情况可向左右跳出。\\n跑步机左右、后方应保持一定安全空间。"},{"name":"噪音说明","value":"产品经过严格测试，可确保噪音水平符合设计标准，但并非完全无声，且受速度、体重、鞋底材质、跑步姿势影响。\\n建议搭配一双优质跑鞋，学习正确的跑步姿势，避免跑步时脚板拍打跑带或拖行。\\n不同楼房地板的构造和厚度不同，对声音的传导也不同，请提前明确家中地板情况，建议靠墙摆放，降低共振可能。\\n禁止摆放在飘窗、榻榻米等非承重面上。"},{"name":"日常保养","value":"每天使用的用户需每3个月进行一次添加润滑油操作，使用频率低的用户可按比例延长加油周期。（提起跑带挤入润滑油，详见说明书）\\n新机（因物流）或使用一段时间后可能出现跑带偏移情况，需要定期检查跑带两侧间隙是否一致，可使用随机附带的L型扳手进行调整（详见说明书）"},{"name":"保修条款","value":"产品自签收之日起，一年保修，以补发配件+师傅上门维修形式进行。属人为损坏的，费用由用户承担。\\n请务必保留原包装30天以上"},{"name":"退换政策","value":"非质量问题退换货说明：产品、配件、说明书、包装应保持完好，产品未安装、未使用。\\n大件商品非质量问题退货，用户需承担往返物流费用（去程150元，回程自行寄回），以及包装费用100元。"}]
